import ExpenseItem from "./ExpenseItem";

function App() {
  const expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];
  return (
    <>
      <ExpenseItem expenseDate={expenses[0].date} expenseTitle={expenses[0].title} expenseAmount={expenses[0].amount}/>
      <ExpenseItem  expenseDate={expenses[1].date} expenseTitle={expenses[1].title} expenseAmount={expenses[1].amount}/>
      <ExpenseItem  expenseDate={expenses[0].date} expenseTitle={expenses[0].title} expenseAmount={expenses[2].amount}/>
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
    </>
  );
}

export default App;
